import React from 'react';


function Header() {
    return (
        <header>
            <nav>
                <button>Home</button>
                <button>Profile</button>
            </nav>
            <h1>Trello Clone</h1>
            <img src="/assets/favicon192.png" alt="logo" />
        </header>
    );
}

export default Header;
